import "./tickets.css";

const Tickets = ({ticket}) => {

  return (
    <div className="tikets-container">
      <div className="tickets-container__item">
        <div className="tickets-container__item__info">
          <div className="tickets-container__item__info__price">
            <div className="price">{ticket.price} P</div>
            <div className="transfer-info">{ticket.to} - {ticket.from}</div>
            <div className="transfer-time-info">{ticket.start} - 13:30</div>
          </div>
          <div className="tickets-container__item__info__time">
            <div className="status">В пути</div>
            <div className="time">8 ч 40 мин</div>
          </div>
          <div className="tickets-container__item__info__company">
            <img className="transfers-img" src="https://www.columbista.com/data/carrier_logo/119/big-5e25826b419b8.png" alt="avia-company"/>
            <div className="transfers">Пересадки</div>
            <div className="transfers-counter">2 пересадки</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Tickets;
